import React from "react";
import "./index.css";

let count = 0;

const myFun = () => {
    count++;
    console.log("clicked " + count);
}

const Plus = () => {
  return (
    <>
      <div className="container">
        <h1 className="head"> {count} </h1>
        <button onClick = {myFun} className="btn">Click me</button>
      </div>
    </>
  );
};

export default Plus ;
